import Home from "./components/Home";
import Header from "./components/Header";
import ProductsState from './components/context/products'
import "./App.css";

function App() {
  return (
    <ProductsState>
    <div className="App">
      <div className="block">
          <Header />
          <Home />
      </div>
    </div>
    </ProductsState>
  );
}

export default App;
